INSERT INTO `auteur` (`id`, `nom`, `biographie`, `date_de_naissance`) VALUES
(1005, 'Joanne Rowling', 'Joanne Rowling (born 31 July 1965), known by her pen name J. K. Rowling, is a British author and philanthropist. She is the author of Harry Potter, a seven-volume fantasy novel series published from 1997 to 2007. The series has sold over 600 million copies, been translated into 84 languages, and spawned a global media franchise including films and video games. The Casual Vacancy (2012) was her first novel for adults. She writes Cormoran Strike, an ongoing crime fiction series, under the alias Robert Galbraith.', '1965-07-31'),
(1006, 'Marcus Aurelius', 'Marcus Aurelius Antoninus (26 April 121 – 17 March 180) was Roman emperor from 161 to 180 and a Stoic philosopher. He was a member of the Nerva–Antonine dynasty, the last of the rulers later known as the Five Good Emperors and the last emperor of the Pax Romana, an age of relative peace, calm, and stability for the Roman Empire lasting from 27 BC to 180 AD. He served as Roman consul in 140, 145, and 161.', '0121-04-26'),
(1007, 'Colleen Hoover', 'Margaret Colleen Hoover (born December 11, 1979) is an American author who writes primarily novels in the romance and young adult fiction genres.[2][1] She is best known for her 2016 romance novel, It Ends with Us. Many of her works were self-published, before they were picked up by a publishing house. As of October 2022, Hoover has sold approximately 20 million books.[3] She was named one of the 100 most influential people in the world by Time magazine in 2023.[', '1979-12-11'),
(1008, 'James Clear', 'James Clear (born 1986) is an American writer. He is best known for his book Atomic Habits. Raised in Hamilton, Ohio, Clear received his degree in biomechanics from Denison University in 2008, where he also served as captain of the baseball team.During his time at university he took part at the St. Gallen Symposium twice and won the Global Essay Competition in his second year attending.', '1986-01-01'),
(1011, 'Harper Lee', 'Harper Lee was an American novelist, widely known for \"To Kill a Mockingbird,\" which won the Pulitzer Prize.', '1926-04-28'),
(1012, 'George Orwell', 'George Orwell was an English novelist, essayist, and critic, famous for his works \"1984\" and \"Animal Farm.\"', '1903-06-25'),
(1013, 'Jane Austen', 'Jane Austen was an English novelist known for her romantic fiction, including \"Pride and Prejudice\" and \"Sense and Sensibility.\"', '1775-12-16'),
(1014, 'F. Scott Fitzgerald', 'F. Scott Fitzgerald was an American novelist, widely regarded as one of the greatest American writers of the 20th century.', '1896-09-24'),
(1015, 'Herman Melville', 'Herman Melville was an American novelist, short story writer, and poet of the American Renaissance period.', '1819-08-01'),
(1016, 'J.D. Salinger', 'J.D. Salinger was an American writer best known for his novel \"The Catcher in the Rye.\"', '1919-01-01'),
(1017, 'J.R.R. Tolkien', 'J.R.R. Tolkien was an English writer, poet, and academic, best known for \"The Hobbit\" and \"The Lord of the Rings.\"', '1892-01-03'),
(1018, 'Leo Tolstoy', 'Leo Tolstoy was a Russian writer and philosopher, renowned for his novels \"War and Peace\" and \"Anna Karenina.\"', '1828-09-09'),
(1019, 'Homer', 'Homer was an ancient Greek poet traditionally said to be the author of the epic poems ', '2024-12-21'),
(1020, 'Dante Alighieri', 'Dante was an Italian poet, writer, and philosopher, best known for his epic poem \"The Divine Comedy.\"', '1265-05-21');

