INSERT INTO `genre` (`id`, `nom`, `description`) VALUES
(1003, 'Action', 'The action is what, specifically, the character does in order to achieve the goal (rescue the princess, steal the diamond). In many cases, this action takes place in a central scene. Central not only in importance, but central in the sense of being in the middle.'),
(1004, 'Self-help', 'A self-help book is one that is written with the intention to instruct its readers on solving personal problems. The books take their name from Self-Help, but are also known and classified under \"self-improvement\", a term that is a modernized version of self-help. Self-help books moved from a niche position to being a postmodern cultural phenomenon in the late twentieth century.'),
(1006, 'Romance', 'The romance genre is often considered one of the most popular book genres, particularly in terms of sales and readership. In the United States, romance novels consistently rank among the top-selling categories, frequently outselling other genres like mystery, science fiction, and fantasy.'),
(1007, 'Fantasy', 'Fantasy literature is literature set in an imaginary universe, often but not always without any locations, events, or people from the real world. Magic, the supernatural and magical creatures are common in many of these imaginary worlds. Fantasy literature may be directed at both children and adults.\r\n\r\n'),
(1010, 'philo', 'jdsvbejvc');

