INSERT INTO `livre` (`id`, `titre`, `auteur_id`, `genre_id`, `ISBN`, `disponible`, `description`, `image`) VALUES
(110, 'Harry Potter', 1005, 1007, '112214', 0, 'Harry Potter is a series of seven fantasy novels written by British author J. K. Rowling. The novels chronicle the lives of a young wizard, Harry Potter, and his friends, Hermione Granger and Ron Weasley, all of whom are students at Hogwarts School of Witchcraft and Wizardry. The main story arc concerns Harrys conflict with Lord Voldemort, a dark wizard who intends to become immortal, overthrow the wizard governing body known as the Ministry of Magic, and subjugate all wizards and Muggles.', 'https://res.cloudinary.com/bloomsbury-atlas/image/upload/w_360,c_scale,dpr_1.5/jackets/9781408855652.jpg'),
(111, 'Meditations', 1006, NULL, '112216', 0, 'Meditations is a series of personal writings by Marcus Aurelius, Roman Emperor from CE 161 to 180, recording his private notes to himself and ideas on Stoic philosophy.', 'https://fcs-img.s3.amazonaws.com/1ebda62b-7f02-4fab-8e39-a5e6016ae6b4/04278914-b119-4c38-a6ed-ad63012b67a4/XL.jpg'),
(112, 'It Ends with Us', 1007, 1006, '333422', 0, 'It Ends with Us is a romance novel by Colleen Hoover, published by Atria Books on August 2, 2016. Based on the relationship between her mother and father, Hoover described it as \"the hardest book Ive ever written\". It explores themes of domestic violence and emotional abuse.', 'https://upload.wikimedia.org/wikipedia/en/e/e4/It_Ends_with_Us_%28Colleen_Hoover%29.png'),
(113, 'Atomic Habits', 1008, 1004, '333559', 1, 'Building on exchanges he had with readers of his e-mail list, in 2018 Clear published his book Atomic Habits on how to build tiny, frequent habits that have a large beneficial and cumulative effect on ones life. According to the intro of his book, he had to build such habits when rehabilitating from a severe cranial injury that he suffered when playing baseball.', 'https://images.epagine.fr/831/9781847941831_1_75.jpg'),
(114, 'good habbits', 1008, 1004, '9948834', 1, 'Improve the way you work--and feel--by forming better habits.\r\n\r\nWe all have habits. Some of them we have carefully established; others we may have simply fallen into. Some help us get our work done; others hold us back.\r\n\r\nThis book explores how to change your behavior to break counterproductive tendencies, combat everyday stressors, and ultimately reach your goals at work and in life.', 'https://cdn11.bigcommerce.com/s-yneuaokjib/images/stencil/original/products/84648/273245/10633_500__62347.1710771153.png'),
(115, 'To Kill a Mockingbird', 1011, 1007, '9780061120084', 1, 'A novel about racism and injustice in the Deep South.', 'https://cdn2.penguin.com.au/covers/original/9781784752637.jpg'),
(116, '1984', 1012, 1007, '9780451524935', 1, 'A dystopian novel that explores the dangers of totalitarianism.', 'https://m.media-amazon.com/images/I/7180qjGSgDL._SL1360_.jpg'),
(117, 'Pride and Prejudice', 1013, 1007, '9781503290563', 1, 'A romantic novel of manners that critiques societal expectations.', 'https://m.media-amazon.com/images/I/812wzoJvRLL._SL1396_.jpg'),
(118, 'The Great Gatsby', 1014, 1007, '9780743273565', 1, 'A story of ambition, love, and the American Dream.', 'https://m.media-amazon.com/images/I/81QuEGw8VPL._SL1500_.jpg'),
(119, 'Moby Dick', 1015, 1007, '9781503280786', 1, 'An epic tale of obsession and revenge on the high seas.', 'https://m.media-amazon.com/images/I/71d5wo+-MuL._SL1200_.jpg'),
(120, 'The Catcher in the Rye', 1016, 1007, '9780316769488', 1, 'A story of teenage rebellion and alienation.', 'https://npr.brightspotcdn.com/dims4/default/48e622e/2147483647/strip/true/crop/363x574+0+0/resize/1760x2784!/format/webp/quality/90/?url=http%3A%2F%2Fnpr-brightspot.s3.amazonaws.com%2Flegacy%2Fsites%2Fwkar%2Ffiles%2Fcatcher_in_the_rye_cover.png'),
(121, 'The Hobbit', 1017, 1007, '9780547928227', 1, 'A fantasy adventure about courage and friendship.', 'https://m.media-amazon.com/images/I/712cDO7d73L._SL1500_.jpg'),
(122, 'War and Peace', 1018, 1007, '9781853260629', 1, 'A historical novel set during the Napoleonic Wars.', 'https://m.media-amazon.com/images/I/81W6BFaJJWL._SL1500_.jpg'),
(124, 'The Divine Comedy', 1020, 1007, '9780140448955', 1, 'A journey through Hell, Purgatory, and Paradise.', 'https://m.media-amazon.com/images/I/51i-9SGWr-L._SY445_SX342_.jpg');

